import { css } from "styled-components";

export const PetalaproNormalWhite15px = css`
  color: var(--white);
  font-family: var(--font-family-petalapro);
  font-size: var(--font-size-m);
  font-style: normal;
`;

export const PetalaproNormalWhite17px = css`
  color: var(--white);
  font-family: var(--font-family-petalapro);
  font-size: var(--font-size-l);
  font-style: normal;
`;
